'''Nínui''' is the second month of the calendar of the [[Dúnedain]]. It was also called [[Nénimë]] in [[Quenya]].<ref>{{App|Calendars}}</ref> Both words mean as much as "Wet"<ref>{{webcite|author=Paul Strack|articleurl=http://eldamo.org/content/words/word-2819130599.html|articlename=S. ''Nínui'' n.|website=[http://eldamo.org/index.html Eldamo - An Elvish Lexicon]|accessed=23 July 2019}}</ref> - presumably a reference to the late winter rains and their results.

